import * as React from "react";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import { Cols, Rows } from "./types";

const columns: Cols[] = [
  { id: "img", label: "사진 이미지", minWidth: 120 },
  { id: "name", label: "상품명", minWidth: 120 },
  { id: "price", label: "가격", minWidth: 170 },
  { id: "button", label: "구매하기", minWidth: 170 },
];

const rows: Rows[] = [
  { img: "🍔", name: "상품A", price: 3000, button: "button" },
  { img: "⚽", name: "상품B", price: 10000, button: "button" },
  { img: "🧢", name: "상품C", price: 15000, button: "button" },
  { img: "💼", name: "상품D", price: 40000, button: "button" },
];

const InfoTable = () => {
  return (
    <Paper sx={{ width: "100%", overflow: "hidden" }}>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  style={{ minWidth: column.minWidth }}
                  align="center"
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1}>
                  <TableCell align={"center"}>{row["img"]}</TableCell>
                  <TableCell>{row["name"]}</TableCell>
                  <TableCell>{row["price"]}</TableCell>
                  <TableCell>{row["button"]}</TableCell>
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default InfoTable;
